import React from "react";

import Grid from "@material-ui/core/Grid";

import ClassificadoItem from "../classificado-item/classificado-item";

const ClassificadoPreview = ({ classificados }) => {
  console.log(classificados);
  return (
    <div className="classificado-preview">
      <Grid container spacing={1}>
        {classificados
          .filter((classificado, idx) => idx < 4)
          .map((classificado) => (
            <ClassificadoItem key={classificado.id} item={classificado} />
          ))}
      </Grid>
    </div>
  );
};

export default ClassificadoPreview;
